import { Routes, Route } from 'react-router-dom';
import FlightList from '../components/FlightList';
import AddNewFlight from '../components/AddNewFlight';

export default function FlightRoute() {
  return (
    <Routes>
      {/* Main flights list page */}
      <Route path="/" element={<FlightList />} />
      
      {/* Alternate path to flights list */}
      <Route path="/flights" element={<FlightList />} />
      
      {/* Add/edit flight page */}
      <Route path="/AddNewFlight/:id" element={<AddNewFlight />} />
    </Routes>
  );
}
